function ExpenseItems()
{
    return(
        <div>
        <h3>Expense Items</h3>
        <table style="width:50%">
            <tr>
                <th>Items</th>
                <th>Cost</th>
            </tr>
            <tr>
                <td>Food</td>
                <td>Rs 10</td>
            </tr>
        </table>
        </div>
    );
}

export default ExpenseItems
